INSERT INTO `exercise` VALUES (1,'2023-10-28','SQL Exercise','INSERT INTO TableName (Column1, Column2) VALUES (Value1, Value2);',1,'SQL'),(2,'2023-10-28','Python Exercise','Write a Python function that calculates the factorial of a number.',1,'python'),(3,'2023-10-28','JavaScript Exercise','Create an array and add elements using push().',1,'javascript'),(4,'2023-12-20','Write a Python function that calculates the factorial of a number.','```python\n def factorial(n):\n    if n == 0 or n == 1:\n        return 1\n    else:\n        return n * factorial(n-1)\n```',1,'python'),(5,'2023-12-22','Write a Java program to find the largest element in an array.','```java\npublic class FindLargestElement {\n    public static int findLargestElement(int[] arr) {\n        int max = arr[0];\n        for (int i = 1; i < arr.length; i++) {\n            if (arr[i] > max) {\n                max = arr[i];\n            }\n        }\n        return max;\n    }\n}\n```',1,'java'),(6,'2023-12-25','Create an SQL query to retrieve the names of employees who have been with the company for more than five years.','```sql\nSELECT EmployeeName\nFROM Employees\nWHERE JoiningDate < CURDATE() - INTERVAL 5 YEAR;\n```',1,'SQL'),(7,'2023-12-28','Develop a JavaScript function that counts the number of vowels in a given string.','```javascript\nfunction countVowels(str) {\n    const vowels = str.match(/[aeiou]/gi);\n    return vowels ? vowels.length : 0;\n}\n```',1,'javascript'),(8,'2023-12-30','Implement a C# program that checks if a given number is a prime number.','```csharp\npublic class PrimeChecker {\n    public static bool IsPrime(int num) {\n        if (num < 2) return false;\n        for (int i = 2; i <= Math.Sqrt(num); i++) {\n            if (num % i == 0) return false;\n        }\n        return true;\n    }\n}\n```',1,'C#'),(9,'2024-01-02','Write a Python function to check if a given string is a palindrome.','```python\n def is_palindrome(s):\n    return s == s[::-1]\n```',1,'python'),(10,'2024-01-05','Create an HTML and CSS form with validation for user registration.','HTML:\n```html\n<form id=\"registrationForm\" onsubmit=\"return validateForm()\">\n    <!-- Form fields go here -->\n    <button type=\"submit\">Register</button>\n</form>\n```\nCSS:\n```css\n/* Add your CSS styles for form styling and validation here */\n```',1,'web'),(11,'2024-01-08','Implement a stack data structure in a programming language of your choice.','```python\nclass Stack:\n    def __init__(self):\n        self.items = []\n\n    def is_empty(self):\n        return len(self.items) == 0\n\n    def push(self, item):\n        self.items.append(item)\n\n    def pop(self):\n        if not self.is_empty():\n            return self.items.pop()\n\n    def peek(self):\n        if not self.is_empty():\n            return self.items[-1]\n```',1,'Algorithm'),(12,'2024-01-10','Solve the \"Fibonacci Sequence\" problem using recursion in a programming language of your choice.','```python\n def fibonacci(n):\n    if n <= 1:\n        return n\n    else:\n        return fibonacci(n-1) + fibonacci(n-2)\n```',1,'Algorithm'),(13,'2024-01-12','Build a React component that fetches and displays data from a public API.','```jsx\nimport React, { useState, useEffect } from \"react\";\n\nfunction DataComponent() {\n    const [data, setData] = useState([]);\n\n    useEffect(() => {\n        fetchData();\n    }, []);\n\n    const fetchData = async () => {\n        const response = await fetch(\"https://jsonplaceholder.typicode.com/posts\");\n        const result = await response.json();\n        setData(result);\n    };\n\n    return (\n        <div>\n            {data.map((item) => (\n                <p key={item.id}>{item.title}</p>\n            ))}\n        </div>\n    );\n}\n```',1,'react'),(14,'2024-01-15','Design an ER diagram for a university database system, including entities for students, courses, and instructors.','```plaintext\n[Student] --Enrolls In--< [Course] >--Taught By--< [Instructor]\n```',1,'Algorithm'),(15,'2023-12-06','Sort a list','```python\n\ndef partition(array, low, high):\n \n    # Choose the rightmost element as pivot\n    pivot = array[high]\n \n    # Pointer for greater element\n    i = low - 1\n \n    # Traverse through all elements\n    # compare each element with pivot\n    for j in range(low, high):\n        if array[j] <= pivot:\n \n            # If element smaller than pivot is found\n            # swap it with the greater element pointed by i\n            i = i + 1\n \n            # Swapping element at i with element at j\n            (array[i], array[j]) = (array[j], array[i])\n \n    # Swap the pivot element with\n    # the greater element specified by i\n    (array[i + 1], array[high]) = (array[high], array[i + 1])\n \n    # Return the position from where partition is done\n    return i + 1\n \n \n# Function to perform quicksort\ndef quicksort(array, low, high):\n    if low < high:\n \n        # Find pivot element such that\n        # element smaller than pivot are on the left\n        # element greater than pivot are on the right\n        pi = partition(array, low, high)\n \n        # Recursive call on the left of pivot\n        quicksort(array, low, pi - 1)\n \n        # Recursive call on the right of pivot\n        quicksort(array, pi + 1, high)\n```',21,'algorithm'),(16,'2023-12-08','exampleexercise','.',21,'html'),(17,'2023-12-09','assembly exercise','answer',1,'assembly');
